import { Typography, Grid, Box } from '@mui/material'
import React from 'react'

const Comment = (props) => {
  return (
    <Grid container p={2}>
    {/* This grid displays username */}
    <Grid item xs={8} md={8}>
       <Typography variant="subtitle2" sx={{color : "#468B97"}}>{props.username}</Typography>
    </Grid>
    {/* this grid displays timestamp */}
    <Grid item xs={4} md={4} sx={{width:"30%", backgroundColor: "pink"}}>
            <Typography variant="subtitle2" sx={{ color : "white"}} >{props.timeStamp}</Typography>
    </Grid>
    {/* This grid displays the question and answer */}
    <Grid item xs={12}>
       <Typography variant="subtitle2" sx={{color : "white"}}>{props.question}</Typography>
       <Typography variant="h6" sx={{color : "white"}} >{props.answer}</Typography>
    </Grid>
</Grid>
  )
}

export default Comment;
